        const remainingKeysSortResult = getYAMLKeysSorted(yamlText, remainingKeys);
        return getTextWithNewYamlFrontmatter(priorityKeysSorted, remainingKeysSortResult.sortedYamlKeyValues, priorityAtStartOfYaml);
